import React from 'react';
import { useNavigate } from 'react-router-dom';
import './navbar.css';

const Navbar = () => {
  const navigate = useNavigate();

  const handleNavigation = (path) => {
    navigate(path);
  };

  return (
    <nav className="navbar">
      <div className='nav-right'>
        <ul>
          <li onClick={() => handleNavigation('/')}>Home</li>
          <li onClick={() => handleNavigation('/about')}>About</li> 
          <li onClick={() => handleNavigation('/contact')}>Contact</li>
          <li onClick={() => handleNavigation('/cart')}>Cart</li>
        </ul>
      </div>
      <div className='center-nav'> {/* Add center-nav class */}
        <ul>
          <li onClick={() => handleNavigation('/men')}>Men</li>
          <li onClick={() => handleNavigation('/women')}>Women</li>
          <li onClick={() => handleNavigation('/kids')}>Kids</li>
        </ul>
      </div>
    </nav>
  );
}

export default Navbar;
